To create a web application using React, Node.js, and Express.js, you can follow these steps:

1. Set up the project structure:

Create a new directory for your project and navigate into it:
```
mkdir my-app
cd my-app
```
Initialize a new Node.js project:
```
npm init -y
```
Install the necessary dependencies:
```
npm install express cors body-parser nodemon concurrently
npx create-react-app client
```
2. Set up the server:

Create a new file called `server.js` in the root directory of your project and add the following code:
```javascript
const express = require('express');
const cors = require('cors');
const bodyParser = require('body-parser');

const app = express();

app.use(cors());
app.use(bodyParser.json());

// Add your routes here

const PORT = process.env.PORT || 5000;

app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
```
3. Set up the client:

Navigate to the `client` directory and install the necessary dependencies:
```
cd client
npm install axios
```
Create a new file called `App.js` in the `client/src` directory and add the following code:
```javascript
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('/api/data');
      setData(result.data);
    };
    fetchData();
  }, []);

  return (
    <div>
      {data.map((item, index) => (
        <div key={index}>{item.name}</div>
      ))}
    </div>
  );
}

export default App;
```
4. Set up the proxy:

Add the following line to the `client/package.json` file:
```json
"proxy": "http://localhost:5000"
```
5. Set up the scripts:

Add the following scripts to the `package.json` file in the root directory of your project:
```json
"scripts": {
  "start": "node server.js",
  "server": "nodemon server.js",
  "client": "npm start --prefix client",
  "dev": "concurrently \"npm run server\" \"npm run client\""
}
```
6. Add dummy data:

Add the following code to the `server.js` file to create a dummy data endpoint:
```javascript
app.get('/api/data', (req, res) => {
  const data = [
    { name: 'Item 1' },
    { name: 'Item 2' },
    { name: 'Item 3' },
  ];
  res.json(data);
});
```
7. Run the application:

Run the following command in the root directory of your project:
```
npm run dev
```
This will start both the server and the client and you should be able to see the dummy data displayed in the browser.

8. Deploy the code:

To deploy the code, you can use a service like Heroku. First, create a new Heroku app and link it to your Git repository. Then, add a `Procfile` to the root directory of your project with the following content:
```
web: npm run start
```
This tells Heroku to run the `start` script when deploying the app. Finally, push your code to the Git repository and Heroku will automatically build and deploy the app.

